// Get the call data
const callData = $input.item.json;
const structuredOutputs = callData.artifact.structuredOutputs;

// Create output object
const result = {};

// Loop through each structured output (includes customCallSummary)
for (const id in structuredOutputs) {
  const output = structuredOutputs[id];
  result[output.name] = output.result;
}

// Also add the default VAPI summary as backup
if (callData.analysis && callData.analysis.summary) {
  result.vapiDefaultSummary = callData.analysis.summary;
}

// Add structured data summary if available
if (callData.analysis && callData.analysis.structuredData && callData.analysis.structuredData.summary) {
  result.structuredDataSummary = callData.analysis.structuredData.summary;
}

return { json: result };
